INSERT INTO `tbl_meal` VALUES (1,'Abgoosht',16,'My Abgoosht does not have any competitor!\nThis Abgoosht is made with lamb, chickpeas, white beans, onion, potatoes, tomatoes, turmeric. The ingredients are combined together and cooked until done, at which point the dish is strained.',18.5000,'Persian','Iran',4,'Abgoosht.jpg'),(2,'Kabab koobideh (Rice and Meat)',16,'We have a very special Kabab Koobideh here!\nLamb or beef is minced twice for finer consistency. Salt, garlic powder, black pepper, sumac, very finely grated onion are added. All ingredients are mixed.\nKabab koobideh is grilled on skewers accompanied by grilled tomatoes and onions. Rice and yellow rice which colored with saffron for design is also available.',13.5000,'Persian','Iran',5,'Kabab koobideh.jpg'),(3,'Polo Morgh (Rice and Chicken)',16,'This dish is bring all the memory that you have from your childhood! First, the chicken is fried in the oil for a very short time and then I cooked it in my special tomato suase. I serve my chicken with rice and yellow rice which is colored with saffron accompanied by berberis which I cook them in little oil and suger wich provide exotic taste between sugary and sourness. For the purpose of design Some pistachio is added as well. Enjoy!',14.0000,'Persian','Iran',5,'Polo Morgh (Rice and Chicken).jpg'),(4,'Borek',12,'You would love this food! Sheets of dough are boiled briefly in large pans, then a mixture of feta cheese, parsley, minced meat, onions, tomato sauce and oil is scattered between the layers. The whole thing is brushed with butter and laid in a masonry oven to cook.',19.0000,'Intercontinental','Turkey',5,'Borek.jpg'),(5,'Ugali Muhogo na Samaki',3,'Cassava flour ugali served with a fresh fish seasoned with all spice, a cabbage cucumber tomato salad, and brazed mchicha greens.',18.5000,'African','Tanzania',5,'Ugali Samaki.jpg'),(6,'Chapati na Kuku',21,'Cardamom fried chapati with a side of stewed chicken leg quarters. Selection of stew vegetables includes peas and carrots, green peppers, and eggplant.',13.5000,'African','Kenya',4,'Chapati kuku.jpg'),(7,'Ndizi Machalari',3,'Chagga cooked matoke plaintains, stewed with your choice of beef, chicken, or pork. Can be ordered with a side of fresh vegetables.',14.0000,'African','Tanzania',5,'Machalari.jpg'),(8,'Pilau',3,'Zanzibari style potato and beef pilau filled with island spices. Comes with a side of banana or kachumbari salad.',19.0000,'African','Tanzania',5,'Pilau.jpg'),(9,'Ugali Nyamachoma',3,'Maize flour ugali served with an assortment of open fire, spicy roasted beef and goat meat, and a tomato, cucumber, and cilantro salad.',20.0000,'African','Tanzania',5,'Ugali nayamachoma.jpg'),(10,'Mexican Chicken Enchiladas',2,'The best enchiladas in Las Vegas! The\ndish is includes 3 fried corn tortillas dipped in a homeade sauce. The tortillas\nare filled with shredded chicken and cheese. Aside from being topped with\nlettuce the dish is served with rice and beans. ',12.0000,'Mexican','Mexico',5,'Enchiladas.jpg'),(11,'Carne Asada Tacos',2,'These tacos will make you feel like you are cooking out with all your friends and family. The\ndish includes 4 tacos and a side of chips and homemade spicy salsa. The tacos are filled with freshly\nprepared beef with homeade spices, onions, and cheese.',14.0000,'Mexican','Mexico',5,'carne-asada-tacos.jpg'),(12,'Chicken Fajitas',2,'The spices in this dish will blow you away! The dish will include chicken fajitas seasoned\nwith spices from a recipe that has been passed along many generations. The fajitas will be topped with grilled onions and\npeppers. Additonally, I will include 3 homemade tortillas and a side of rice and beans.',13.0000,'Mexican','Mexico',5,'Chicken-Fajitas.jpg'),(13,'Spanish Paella',11,'The best paella you will ever have. As an immigrant from Spain I have perfected this dish.\nPaella is a rice dish that will surely fill you up. The dish is prepared with shrimp, oysters, octopus and cheese.',18.0000,'Spanish','Spain',5,'mixed-seafood-paella.jpg'),(15,'Pizza',31,'HI cgnfgf bgbhfgh fgfg dfdfd fdfdfdfdfd ddfdfdfd',20.0000,'African','American Samoa',0,'Pizza.jpg'),(17,'fOOD',31,'TYUTUTYUT',54.0000,'African','Algeria',0,'Food.jpg'),(18,'FOOD2',31,'GHJGKYUYIYUI',28.0200,'Intercontinental','Algeria',0,'FOOD2.jpg');
